import React from "react";
import { View, Text, TouchableOpacity, StyleSheet, ImageBackground } from 'react-native';
const ReporteScreen = ({navigation}) => {
    const denuncias = [
        {
          tipo: 'Reporte Movilidad',
          descripcion: 'Reporta fallas en la movilidad del tráfico y su posible causa (Accidente vial, bloqueos, Fallas estructurales, etc.) Asi como fallas de accesibilidad para personas con necesidades especiales',
            
        },
         {
          tipo: 'Reporte Servicios publicos',
          descripcion: 'Reporta fallas en cualquier servicio publico (Agua, luz, drenaje, limpieza)',
            
        },
    ]
}
